import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
  Outlet,
  NavLink,
  useParams,
} from "react-router-dom";

// JSON Dummy Data untuk Login
const dummyUser = {
  email: "admin@example.com",
  password: "admin123",
};

// Layout untuk Authentication
const AuthLayout = ({ children }) => (
  <div className="auth-layout">
    <h2>Auth Layout</h2>
    {children}
  </div>
);

// Layout untuk Admin
const AdminLayout = () => (
  <div className="admin-layout">
    <nav>
      <NavLink to="dashboard">Dashboard</NavLink>
      <NavLink to="mahasiswa">Mahasiswa</NavLink>
    </nav>
    <Outlet />
  </div>
);

// Halaman Login
const Login = () => {
  const handleLogin = (event) => {
    event.preventDefault();
    localStorage.setItem("isAuthenticated", "true");
    alert("Login Berhasil!");
    window.location.href = "/admin"; // Redirect
  };

  return (
    <AuthLayout>
      <form onSubmit={handleLogin}>
        <input type="email" placeholder="Email" required />
        <input type="password" placeholder="Password" required />
        <button type="submit">Login</button>
      </form>
    </AuthLayout>
  );
};

// Protected Route
const ProtectedRoute = ({ children }) => {
  return localStorage.getItem("isAuthenticated") === "true" ? (
    children
  ) : (
    <Navigate to="/login" replace />
  );
};

// Halaman Dashboard
const Dashboard = () => <h2>Dashboard Admin</h2>;

// Halaman Mahasiswa
const Mahasiswa = () => {
  return (
    <div>
      <h2>Mahasiswa</h2>
      <NavLink to="1">Mahasiswa 1</NavLink>
      <NavLink to="2">Mahasiswa 2</NavLink>
      <Outlet />
    </div>
  );
};

// Detail Mahasiswa
const MahasiswaDetail = () => {
  const { id } = useParams();
  return <h3>Detail Mahasiswa {id}</h3>;
};

// Router Setup
const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="login" element={<Login />} />
        <Route
          path="admin"
          element={
            <ProtectedRoute>
              <AdminLayout />
            </ProtectedRoute>
          }
        >
          <Route path="dashboard" element={<Admin />} />
          <Route path="mahasiswa" element={<Mahasiswa />}>
            <Route path=":id" element={<MahasiswaDetail />} />
          </Route>
        </Route>
        <Route path="*" element={<Navigate to="/login" />} />
      </Routes>
    </Router>
  );
};

export default App;
